import { Navbar, Nav, Container } from 'react-bootstrap';
import house from '../images/logo.png';

function Menu() {
    return (
        <Navbar bg="light" expand="lg">
            <Container>
                <Navbar.Brand href="/"><img src={house} alt="" width="40"/></Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="/" className="text-black">Home</Nav.Link>
                        <Nav.Link href="/about" className="text-black">About</Nav.Link>
                        <Nav.Link href="/contact" className="text-black">Contact</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default Menu;
